<!doctype html><html lang="en"><head data-config=""><meta http-equiv="Content-type" content="text/html; charset=utf-8"/><meta name="viewport" content="width=device-width,initial-scale=1,shrink-to-fit=no"/><script nonce="[[random]]">window.__webpack_public_path__="[[staticsPath]]/teams-modular-packages/hashed-assets/";</script><style>html,
      body {
        font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Web', sans-serif;
        width: 100%;
        height: 100%;
        padding: 0;
        margin: 0;
      }

      html {
        font-size: 10px;
      }

      body {
        font-size: 1.4rem;
        overflow: hidden;
      }

      /** Enable antialiasing and font smoothing across supporting browsers for all elements */
      * {
        -webkit-font-smoothing: antialiased;
        -moz-osx-font-smoothing: grayscale;
      }

      /*!*Remove hidden ADAL iframes borders as to not cause unnecessary vertical scrolling*!*/
      body > iframe[id^="adal"] {
        border: 0;
      }</style><style id="splash-styles">/** Remove outline, when focusing splash screen, because it is not necessary to inform user about focus on that element. */
  div[id="splash-screen"] {
    outline: none;
  }


  /** Below styles are dedicated for the pre-loading wheel (before React loads) */
  .ui.loader {
    display: none;
    position: absolute;
    top: 50%;
    left: 50%;
    margin: 0;
    text-align: center;
    z-index: 1000;
    -webkit-transform: translateX(-50%) translateY(-50%);
    transform: translateX(-50%) translateY(-50%);
  }

  .ui.loader:before {
    position: absolute;
    content: "";
    top: 0;
    left: 50%;
    width: 100%;
    height: 100%;
    border-radius: 500rem;
    border: 0.2em solid rgba(0, 0, 0, 0.1);
  }

  .ui.loader:after {
    position: absolute;
    content: "";
    top: 0;
    left: 50%;
    width: 100%;
    height: 100%;
    -webkit-animation: loader 0.6s linear;
    animation: loader 0.6s linear;
    -webkit-animation-iteration-count: infinite;
    animation-iteration-count: infinite;
    border-radius: 500rem;
    border-color: #767676 transparent transparent;
    border-style: solid;
    border-width: 0.2em;
    -webkit-box-shadow: 0 0 0 1px transparent;
    box-shadow: 0 0 0 1px transparent;
  }

  @-webkit-keyframes loader {
    from {
      -webkit-transform: rotate(0);
      transform: rotate(0);
    }

    to {
      -webkit-transform: rotate(360deg);
      transform: rotate(360deg);
    }
  }

  @keyframes loader {
    from {
      -webkit-transform: rotate(0);
      transform: rotate(0);
    }

    to {
      -webkit-transform: rotate(360deg);
      transform: rotate(360deg);
    }
  }

  .ui.large.loader:after,
  .ui.large.loader:before {
    width: 3.42857143rem;
    height: 3.42857143rem;
    margin: 0 0 0 -1.71428571rem;
  }

  .ui.text.loader {
    width: auto !important;
    height: auto !important;
    text-align: center;
    font-style: normal;
  }

  .ui.loader.active,
  .ui.loader.visible {
    display: block;
  }

  .ui.loader.disabled,
  .ui.loader.hidden {
    display: none;
  }

  .ui.large.text.loader {
    min-width: 3.42857143rem;
    padding-top: 4.21428571rem;
  }

  @-webkit-keyframes fadeOut {
    from {
      opacity: 1;
    }

    to {
      opacity: 0;
    }
  }

  @keyframes fadeOut {
    from {
      opacity: 1;
    }

    to {
      opacity: 0;
    }
  }

  .ui.loader.fadeOut {
    -webkit-animation: fadeOut 500ms linear;
    animation: fadeOut 500ms linear;
  }</style><style id="loading-screen-styles">.loading-screen-container {
    outline: none;
    height: 100vh;
    overflow: hidden;
    -webkit-app-region: drag;
    border: none;
    background-color: #FFFFFF;
    display: flex;
    align-items: center;
    padding: 4rem 4rem 0 4rem;
    flex-direction: column;
    position: relative;
  }

  .loading-screen-container h1,
  .loading-screen-container h2 {
    font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Web', sans-serif;
    font-style: normal;
    text-align: center;
    color: #000000;
    margin: 0;
  }

  .loading-screen-container h1 {
    font-weight: 600;
    font-size: 1.8rem;
    line-height: 2.4rem;
    padding: 2.6rem 0 0 0;
  }

  .loading-screen-container h2 {
    font-family: Teams Assets;
    font-weight: normal;
    font-size: 1.4rem;
    line-height: 1.7rem;
    padding: 0;
  }

  img.loading-screen-people {
    width: 18rem;
    height: 16.6rem;
  }

  .loader-container {
    width: 2.637rem;
    height: 2.637rem;
    position: relative;
    padding: 1.6rem 0;
  }

  /** Overwriting loader default styles for Embed */
  .ui.loader {
    top: unset;
    left: unset;
  }

  .ui.loader:after,
  .ui.loader:before {
    width: 2.05rem;
    height: 2.05rem;
  }

  .ui.loader:before {
    border: none;
  }

  .ui.loader:after {
    border-color: #BDBDE6 transparent transparent;
  }</style></head><body><div style="display: none; height: inherit;" id="app"></div><div tabindex="-1" role="progressbar" aria-valuetext="Loading..." class="loading-screen-container"><img class="loading-screen-people" src="data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAWgAAAFLCAYAAAD73RZNAAAABmJLR0QA/wD/AP+gvaeTAAAACXBIWXMAAAsTAAALEwEAmpwYAAAAB3RJTUUH5AoTDRc1EvXAAgAAAB1pVFh0Q29tbWVudAAAAAAAQ3JlYXRlZCB3aXRoIEdJTVBkLmUHAAAgAElEQVR42uy9eZAk130m9r086z66u/qcnuk5McBgBgBBAIRIQaRESpR1rWLllXZlh3cjHA57I/SnN/yH7T8cXsdurCO84V0rbK9Duw5R1q6sk6YkUiRFgiAA4poBZoC5Z3r6Puq+8s73/EdWZWVd3dXd1VXVNfmLALqmXmZWHi+/973v/Q7CGGPwzbcRNtMwsLOzjVwuC1VRhnYehBCEwmFMTExicioFWZb9h+Pb8fY5H6B9G1WzLAsb62vY2d7CqHVTQRAwMzOH2fl5CILgPyzffID27emxbDaDJ48fwbKskT5PORDA0tmzSCQm/Ifmmw/Qvo2/PXpwH5lM+sScL8dxWFg8jfn5Bf/h+dbfvuXfAt9GyR4/fHCiwBkAKKVYX13B9taW/wB98wHat/G0zY11pNO7J/LcGWNYW32CfC7nP0jffID2bbysXC5jbXXlRF8DpRRPlh9B13X/gfrmA7Rv42GMMTx+9GAsrsUwDKytrfgP1TcfoH0bD8ukd6Gp6thcTz6bRbVS8R+sbz5A+3bybWd7vBbXKKXY3d3xH6xvPkD7drJNURRUq9Wxu65CPg/btv0H7JsP0L6dXCsWC2N5XYahQ1Gq/gP2zQdo306uVcpl/9p8880HaN9G0TRVGd9r0zT/AfvmA7RvJ9QYO7JOy3EcOI7reVtCSN+P281M0/SfsW9HMj8Nl2/Dw2fg0FnqOI7D5OQkotEoCCGoVCrY3d3teDye5zE9PY1QKAQAKBQKyGaznV8IQcDU1BTC4TAYYygUCsjn84c7T0b9h+ybD9C+HZS4Mgc86qBDCEB6Z5ejYBMTE0gkEu6/Y7EYKKVIp9vzeExPTyMSiTTta9s2CoX2BcpUKtW07eTkJCilHbf1zTcfoH07kFFLh6VVYFRyMKpFWHoF1NRgmzqYbYJRG4zaAKNglIIBIDVwJoIEMRiFGIxBDCcRiE1DDCdBuNFTwsLhcNt30Wi0I0B32jYSibSBLsdxLsveb1vffPMB2ree2LClFKHk1qFk12CUM7ANrSYgHND0Ksxqvhm0pACC8TmEphYRTMxDCMVGZxbQYgfRszvtzxgDpbRNe6bUlyp88wHatwOYpVVQ2XmE6u4yjErWYcXHwcgNDdX0MqrpZRDCIZCYRfz08whOnB4qs87n85idnW0C12Kx2HHbXC6HycnJpm07MeL6MVq37XZc33zzAdq3JjPVEoqrN1HZfghqGQNmrRRqfhNqfhNiOInE6WuIzJ4H4Y7SjQ6ne5fLZTDGEI/HwRhDpVJBuYvfcS6Xg23biEajoJSiWCx2jV6sbxuJRFwgVw5bB5H4TlK+Hc38iionhTEbCoqrt1DeuDNwYN7LxHASk+dfRSh1+lBge/OTG0MtBHuclkpN49yFi37n9c1n0GNrjKG8/QD5xx/C0kYvQ5pZzWP75ncQmb2IifOvQAhEDrS/LAfGFqDlQMDvv775AD2+rFlF/tEHKG/ePUb8dyZQR3Wxq2w/gFbYxtTlLyI0ebrn/cKRCAr58axCEo5E/U7s25HMF8lG1EyliM2P/uJYwRlwPBSobYP1wVPB0srY+eRvkF/
